import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import './textfields.css';
import {Link} from 'react-router-dom';
import Navigation from "../../Navigation/Navigation";

class RowEnquiry extends Component{
    constructor(props) {
        super(props);
        this.state =
            {
                UsernameChange : "",
                passwordChange : "",
                name: "Sign In"
            };
        this.onEmailChange = this.onEmailChange.bind(this);
        this.onPasswordChange = this.onPasswordChange.bind(this);
        // this.onSubmitClicked = this.onSubmitClicked.bind(this);
    }

    render() {
        return (
            <div>
                <Navigation name={this.state.name}/>
                <form className='hello'>
                    <div className="form-group">
                        <label htmlFor="exampleInputEmail1">Zone Number</label> <br />
                        <input type="number"
                               name="zone"
                               className="form-control"
                               id="exampleInputEmail1"
                               aria-describedby="emailHelp"
                               placeholder="Enter Username"
                               onChange={this.onEmailChange}
                        />
                        <br />
                        <label htmlFor="exampleInputPassword1">Row Number</label><br />
                        <input type="number"
                               name="row"
                               className="form-control"
                               id="exampleInputPassword1"
                               placeholder="Password"
                               onChange={this.onPasswordChange}
                        />
                        <br />
                        <Link className="btn btn-success button" to="/rowstats">Get the status</Link>
                    </div>
                </form>
            </div>
        );
    }

    onEmailChange(event) {
        this.setState(
            {UsernameChange : event.target.value},
        );
    }

    onPasswordChange(event) {
        this.setState(
            {passwordChange : event.target.value},
        );
